import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import './MovieDetailPage.css';

const MovieDetailPage = () => {
    const { id } = useParams();
    const navigate = useNavigate();
    const [movie, setMovie] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchMovie = async () => {
            try {
                setLoading(true);
                const response = await fetch(`http://localhost:8080/api/movies/${id}`);

                if (!response.ok) {
                    throw new Error('Failed to fetch movie details');
                }

                const data = await response.json();
                setMovie(data);
                setLoading(false);
            } catch (err) {
                setError(err.message);
                setLoading(false);
            }
        };

        fetchMovie();
    }, [id]);

    const handleGoBack = () => {
        navigate(-1);
    };

    if (loading) {
        return (
            <div className="movie-detail-page loading">
                <div className="loading-spinner"></div>
                <p>Loading movie details...</p>
            </div>
        );
    }

    if (error) {
        return (
            <div className="movie-detail-page error">
                <div className="error-message">
                    <h2>Error</h2>
                    <p>{error}</p>
                    <button className="back-button" onClick={handleGoBack}>
                        Go Back
                    </button>
                </div>
            </div>
        );
    }

    if (!movie) {
        return (
            <div className="movie-detail-page not-found">
                <h2>Movie Not Found</h2>
                <p>The movie you're looking for doesn't exist or has been removed.</p>
                <button className="back-button" onClick={handleGoBack}>
                    Go Back
                </button>
            </div>
        );
    }

    return (
        <div className="movie-detail-page">
            <button className="back-button" onClick={handleGoBack}>
                ← Back to Results
            </button>

            <div className="movie-detail-container">
                <div className="movie-poster">
                    {movie.posterImage ? (
                        <img src={movie.posterImage} alt={`${movie.title} poster`} />
                    ) : (
                        <div className="placeholder-poster">
                            <span>{movie.title.charAt(0)}</span>
                        </div>
                    )}
                </div>

                <div className="movie-info">
                    <h1 className="movie-title">
                        {movie.title} <span className="movie-year">({movie.releaseYear})</span>
                    </h1>

                    <div className="movie-meta">
                        {movie.genre && <span className="movie-genre">{movie.genre}</span>}
                        {movie.rating && (
                            <div className="movie-rating">
                                <span className="star-icon">★</span>
                                <span>{movie.rating}/10</span>
                            </div>
                        )}
                    </div>

                    <div className="movie-details">
                        <div className="detail-group">
                            <h3>Director</h3>
                            <p>{movie.director || 'Not available'}</p>
                        </div>

                        <div className="detail-group">
                            <h3>Cast</h3>
                            <p>{movie.casting || 'Not available'}</p>
                        </div>

                        <div className="detail-group">
                            <h3>Overview</h3>
                            <p className="movie-description">{movie.description || 'No description available.'}</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default MovieDetailPage;
